import Mix from "../Mix";

const MixContainer = ({ stations }) => (
  <section class="flex">
    {stations.map((mixes) => (
      <div>
        {mixes.map((mix) => (
          <div class="outline w-25 pa3 mr2"> 
            <h2>{mix.name}</h2>
          </div>
        ))}
      </div>
    ))}
  </section>
);

export default MixContainer;
